import React from "react";

function ArtworkDetails() {
  return (
    <div className="main">
      <div className="left-side">
        <div className="artwork-image"></div>
        <div className="rating"></div>
      </div>
      <div className="right-side"></div>
    </div>
  );
}
export default ArtworkDetails;
